import React, { useState } from 'react';
import { AuthService } from '../../services/apiService.js';
import './AuthCommon.css';
import './Register.css';    // Estilos específicos

const Register = ({ onRegisterSuccess, onGoToLogin }) => {
    const [formData, setFormData] = useState({
        nombre: '',
        correo: '',
        contrasena: '',
        confirmarContrasena: '',
        rol: 'estudiante'
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');
        setSuccess('');

        // Validaciones
        if (formData.contrasena !== formData.confirmarContrasena) {
            setError('Las contraseñas no coinciden');
            setLoading(false);
            return;
        }

        if (formData.contrasena.length < 6) {
            setError('La contraseña debe tener al menos 6 caracteres');
            setLoading(false);
            return;
        }

        try {
            const resultado = await AuthService.registrar({
                nombre: formData.nombre,
                correo: formData.correo,
                contrasena: formData.contrasena,
                rol: formData.rol
            });
            
            if (resultado.error) {
                setError(resultado.error);
            } else {
                setSuccess('¡Registro exitoso! Redirigiendo al login...');
                // Opcional: redirigir automáticamente después de 2 segundos
                setTimeout(() => {
                    onGoToLogin();
                }, 2000);
            }
        } catch (error) {
            setError('Error de conexión con el servidor');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="auth-container register-container">
            <div className="auth-card">
                <h2>Crear Cuenta</h2>
                <form onSubmit={handleSubmit}>
                    {error && <div className="error-message">{error}</div>}
                    {success && <div className="success-message">{success}</div>}
                    
                    <div className="form-group">
                        <label htmlFor="nombre">Nombre Completo</label>
                        <input
                            type="text"
                            id="nombre"
                            name="nombre"
                            value={formData.nombre}
                            onChange={handleChange}
                            required
                            placeholder="Tu nombre completo"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="correo">Correo Electrónico</label>
                        <input
                            type="email"
                            id="correo"
                            name="correo"
                            value={formData.correo}
                            onChange={handleChange}
                            required
                            placeholder="usuario@ejemplo.com"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="rol">Tipo de Usuario</label>
                        <select
                            id="rol"
                            name="rol"
                            value={formData.rol}
                            onChange={handleChange}
                            required
                        >
                            <option value="estudiante">Estudiante</option>
                            <option value="profesor">Profesor</option>
                        </select>
                    </div>

                    <div className="form-group">
                        <label htmlFor="contrasena">Contraseña</label>
                        <input
                            type="password"
                            id="contrasena"
                            name="contrasena"
                            value={formData.contrasena}
                            onChange={handleChange}
                            required
                            placeholder="Mínimo 6 caracteres"
                            minLength="6"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="confirmarContrasena">Confirmar Contraseña</label>
                        <input
                            type="password"
                            id="confirmarContrasena"
                            name="confirmarContrasena"
                            value={formData.confirmarContrasena}
                            onChange={handleChange}
                            required
                            placeholder="Repite tu contraseña"
                        />
                    </div>

                    <button 
                        type="submit" 
                        className="auth-button register-button"
                        disabled={loading}
                    >
                        {loading ? 'Creando Cuenta...' : 'Registrarse'}
                    </button>
                </form>

                <div className="auth-links">
                    <p>¿Ya tienes cuenta? <a href="#" onClick={onGoToLogin}>Inicia Sesión aquí</a></p>
                </div>
            </div>
        </div>
    );
};

export default Register;
